    return (
        <div className="demande">
        <form action="/tirage">
        <fieldset>
          <legend>Ecrivez votre question en dessous pour un tirage en croix</legend>
      
          <input type="text" name="nom"  />
      
       

        </fieldset>
        <input type="submit" value="Envoyer votre question vers un tirage en croix +" id="btnenvoi"></input>
        
      </form>  
      
      <form action="/tirage2">
        <fieldset>
          <legend>Ecrivez votre question en dessous pour un tirage en ligne</legend>
      
          <input type="text" name="nom2"  />
      
       

        </fieldset>
        <input type="submit" value="Envoyer votre question vers un tirage en ligne -" id="btnenvoi"></input>
        
      </form>  
      
      
      
      
      <img src={bougie} /> </div>
      
    );
  }
  
  export default Formquestion;
